          class: `sku-wrapper`,
          interactive: true,
          elevated: 2,
          fluid: true
        }, m(`.sku`, m(`.sku-title.flex.row`, {
            style: 'margin:10px'
          },
          // here will go skuString , svgButton and skuPrice
          m('.string', sku.string),
          m(Popover, {
            class: 'sku-picture',
            hasArrow: true,
            hasBackdrop: false,
            position: 'top',
            interactionType: 'click',
            hasBackdrop: false,
            content,
            trigger: m(Button, {
              class: 'get-image',
              iconLeft: Icons.IMAGE,
              basic: true,
              size: 'xl',
              loading: vnode.state.loading,
